import "./style/styleButton.css";

function ButtonAgendar() {
  return (
    <div id="containerButtonAgendar">
      <input
        value="Agendar"
        type="submit"
        id="buttonProximo"
        className="buttonAgendar"
      />
    </div>
  );
}

export default ButtonAgendar;
